// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.13;

import "./ERC721Token.sol";

contract Adapter {

    event AdapterMinted(address contractCollection, address owner, uint256 tokenId);

    Collection[] private collections;

    struct Collection{
        string name;
        ERC721Token token;
        address owner;
    }

    mapping(address => ERC721Token) public mapCollections;

    function addCollection(string memory _name, ERC721Token _token, address _owner )external{
        require(collections.length <= 3 gwei, "Security warning, gwei too high");
        ERC721Token token = ERC721Token(_token);
        Collection memory collection = Collection(_name, token, _owner);
        collections.push(collection);
        mapCollections[address(token)] = token;
    }

    function mint(address _contract) public {
        uint256 tokenId = mapCollections[_contract].mint();

        emit AdapterMinted(_contract, msg.sender, tokenId);
    }
}
